  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0081035 includes biological,
  chemical, meteorological, physical and underway - surface data collected from EXPLORER
  OF THE SEAS in the Bay of Fundy, Caribbean Sea, Gulf of Mexico, North Atlantic Ocean
  and Stellwagen Bank National Marine Sanctuary from 2006-12-31 to 2007-12-01 and
  retrieved during cruise EX0701 - EX0747. These data include AIR TEMPERATURE, BAROMETRIC
  PRESSURE, CARBON DIOXIDE - AIR, CARBON DIOXIDE - PARTIAL PRESSURE - DIFFERENCE,
  DISSOLVED OXYGEN, FLUORESCENCE, Partial pressure (or fugacity) of carbon dioxide,
  SALINITY, SEA SURFACE TEMPERATURE, WIND DIRECTION and WIND SPEED. The instruments
  used to collect these data include Barometric pressure sensor, Carbon dioxide (CO2)
  gas analyzer, Shower head chamber equilibrator for autonomous carbon dioxide (CO2)
  measurement and thermosalinographs. These data were collected by Rik Wanninkhof
  of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory as part
  of the VOS Explorer of the Seas Lines 2007 data set.nnThe Global Volunteer Observing
  Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon Coordination
  Project (IOCCP). International groups from 14 countries have been outfitting research
  ships and commercial vessels with automated CO2 sampling equipment to analyze the
  carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
